import React from 'react';
import AppContent from '../Content/AppContent';
import AppbarGeneric from '../Generics/AppbarGeneric';

const useStyles = makeStyles((theme) => ({
    content: {
        justifyContent:"center",
        alignItems:"center",
        overflowX: "hidden"
    }
}));

const ProfilePage: React.FC = () => {

    const styles = useStyles();

    return(
        <React.Fragment>
        <AppbarGeneric />
            <AppContent>
            <div style={{margin:0, padding:20}}>
                <GridList cols={2} className={styles.content}>
                    <GridListTile style={{backgroundColor: 'green', height: '50px'}}>

                    </GridListTile>
                    <GridListTile style={{backgroundColor: 'green', height: '50px'}}>

                    </GridListTile>
                </GridList>
